Step-by-step reasoning:
1. Key psychological mechanisms: Responder behavior is driven by both the absolute monetary gain (split_self) and fairness considerations—in particular, the discomfort when the offered amount falls short of a “fair share.” The fair share is computed from the participant’s token contribution relative to the total tokens. When the offer is below this fair share, the responder’s utility is penalized proportionally to the shortfall (normalized as a percentage of the fair share). If the offer meets or exceeds the fair share, no fairness penalty is applied.
2. Mechanism interaction: The model first computes the fair share (r) from combined_earning multiplied by the relative token contribution. It then computes the shortfall (if any) relative to this benchmark, normalized by r so that the penalty reflects the percentage deviation rather than the absolute difference. The overall utility is then the offered amount plus a baseline bias (mu) minus a penalty scaled by a fairness sensitivity parameter (lambda) for offers falling below the fair share.
3. Mathematical form: We define r = combined_earning×(token_self/(token_self+token_opp)) and then penalize only when the offered split (split_self) is below r. The penalty is formulated as lambda multiplied by the proportional shortfall max((r − split_self)/r, 0). Finally, the responder’s utility is given by U = mu + split_self − [lambda × (max((r − split_self)/r, 0)].
4. Learnable parameters: There are two learnable parameters:
  • mu: a baseline utility bias, with generous bounds (e.g. [–100, 100]).
  • lambda: a fairness sensitivity parameter, with moderate non-negative bounds (e.g. [0, 10]).
5. Observables mapping: The observed variables (split_self, combined_earning, token_self, token_opp) are used to compute the fairness benchmark (r) and the normalized penalty. The resulting calculated utility (U) is then used to predict the probability of accepting the offer (after combining with a standard temperature parameter outside this utility function).

Below is the formal specification:

<MODEL>
Let r = combined_earning × ( token_self / (token_self + token_opp) )
Then, define the normalized shortfall as: S = max((r − split_self) / r, 0)
The utility for an offer is:
 U = mu + split_self − lambda × S
</MODEL>

